import { Component } from '@angular/core';

@Component({
  selector: 'app-main',
  templateUrl: './main.component.html',
  styleUrls: ['./main.component.css']
})
export class MainComponent {

}
<div>
  <button routerLink="/lançamentos">Lançamentos</button>
  <button routerLink="/balanço">Balanços</button>
  <button routerLink="/testes">Calculadora</button>
  </div>
